// Main Object Container
var obj = {};
var sprites = {};

var scene = new THREE.Scene();
var camera = new THREE.PerspectiveCamera( 75, window.innerWidth / window.innerHeight, 1, 1000 );
camera.position.z = 500;

var renderer = new THREE.WebGLRenderer();
renderer.setSize( window.innerWidth, window.innerHeight );
document.body.appendChild( renderer.domElement );

// Lighting
var ambientLight = new THREE.AmbientLight(0xbbbbbb);
scene.add(ambientLight);

// directional lighting
var directionalLight = new THREE.DirectionalLight(0xffffff);
directionalLight.position.set(10, 10, 10).normalize();
scene.add(directionalLight);

// need cleaner way to store these
sprites.mc_grass_top = "data:image/jpeg;base64,";

sprites.mc_dirt_side = "data:image/png;base64,";

sprites.mc_dirt = "data:image/jpeg;base64,";


function createDirtObject() {
  
  // dirt side
  var m1 = createTexture(sprites.mc_dirt_side);
  // dirt
  var m2 = createTexture(sprites.mc_dirt);
  // grass top
  var m3 = createTexture(sprites.mc_grass_top);
  
  var materials = [m1, m1, m3, m2, m1, m1];
  
  var cube = new THREE.Mesh(
    new THREE.BoxGeometry( 200, 200, 200, 1, 1, 1 ),
    new THREE.MeshFaceMaterial(materials)
  );
  cube.overdraw = true;
  cube.rotation.x = Math.PI * 0.2;
  
  return cube;
}

function createTexture(source) {
  var image = document.createElement('img');
  image.src = source;
  var texture = new THREE.Texture(image);
  texture.needsUpdate = true;
  var mat = new THREE.MeshLambertMaterial({map: texture });

  return mat;
}



function init() {
  addObjects();  
  
  render();
}

function addObjects() {
  
   obj.dirt = createDirtObject();
   scene.add(obj.dirt);
  
}

function render() {
  requestAnimationFrame( render );
  
  //obj.dirt.rotation.x += 0.01;
  obj.dirt.rotation.y += 0.01;
  //obj.dirt.rotation.z += 0.01;

  renderer.render( scene, camera );
}


window.onload = init();